(40, 28, 26, 'Did Dr Yunus deserve such denigration?', '&lt;p&gt;&lt;span style=&quot;color: #101828; font-family: &#039;Noto Serif JP&#039;, serif; font-size: 18px; background-color: #ffffff;&quot;&gt;We are shocked that the country&#039;s only Nobel Laureate, Dr Muhammad Yunus, has been&amp;nbsp;&lt;/span&gt;&lt;a style=&quot;box-sizing: inherit; background-color: #ffffff; line-height: inherit; color: #1779ba; text-decoration-line: none; cursor: pointer; transition-property: color, opacity, background-color, border-color, box-shadow; transition-duration: 0.3s; font-family: &#039;Noto Serif JP&#039;, serif; font-size: 18px;&quot; href=&quot;https://www.thedailystar.net/news/bangladesh/crime-justice/news/prof-yunus-sentenced-6-months-jail-3508576&quot; target=&quot;_blank&quot; rel=&quot;noopener&quot;&gt;sentenced to six months&#039; jail&lt;/a&gt;&lt;span style=&quot;color: #101828; font-family: &#039;Noto Serif JP&#039;, serif; font-size: 18px; background-color: #ffffff;&quot;&gt;&amp;nbsp;in a case filed by the government over labour law violations. Given that there are many cases of grave labour law violations that are constantly&amp;nbsp;&lt;/span&gt;&lt;a style=&quot;box-sizing: inherit; background-color: #ffffff; line-height: inherit; color: #1779ba; text-decoration-line: none; cursor: pointer; transition-property: color, opacity, background-color, border-color, box-shadow; transition-duration: 0.3s; font-family: &#039;Noto Serif JP&#039;, serif; font-size: 18px;&quot; href=&quot;https://www.tbsnews.net/economy/labour-welfare-largely-neglected-few-companies-share-profit-564442&quot;&gt;overlooked&lt;/a&gt;&lt;span style=&quot;color: #101828; font-family: &#039;Noto Serif JP&#039;, serif; font-size: 18px; background-color: #ffffff;&quot;&gt;&amp;nbsp;in the country, many human rights defenders have rightly expressed concerns about the prosecution of Dr Yunus, calling the charges against him &quot;frivolous&quot; and the verdict &quot;disproportionate&quot;. And to our knowledge, no such factory inspection has ever been conducted nor cases filed by the Department of Inspection for Factories and Establishments (DIFE)&lt;/span&gt;&lt;/p&gt;\r\n&lt;p&gt;&lt;span style=&quot;color: #101828; font-family: &#039;Noto Serif JP&#039;, serif; font-size: 18px; background-color: #ffffff;&quot;&gt;&lt;img src=&quot;data:image/png;base64,&quot; alt=&quot;&quot; width=&quot;100&quot; height=&quot;100&quot; /&gt;&lt;/span&gt;&lt;/p&gt;', 1, '2024-01-04 01:26:32');

